import React from 'react';
import * as ReactDOMClient from 'react-dom/client';
const Clicking = () => console.log("Yeees")
const mouseK = () => console.log("noood")
const helpText = "Help text"


const elemets = (<div className='name'>
  <input placeholder={helpText} onClick={Clicking} onMouseEnter={mouseK} />
  <p>{1 + 5}</p>
  <p>{helpText === "Help text" ? "Yes" : "No"}</p>
</div>)


const root = document.getElementById("root") as HTMLElement;

const writ = ReactDOMClient.createRoot(root);
